import React,
      { Component } from 'react';
import { Link } from 'react-router-dom';

import Header                   from './../../components/Header';
import Footer                   from './../../components/Footer';
import CoverPage                from './../../components/CoverPage/TitleText';

class Carrers extends Component {
  render() {
    return (
      <div>

        <Header />

        <CoverPage
          title={(<span>Estamos procurando por <b>pessoas Criativas e Inteligentes</b><br /> para se juntar ao nosso time.</span>)} />

        <label data-label-carrer>Desenvolvedores</label>

        <div data-content-job>
          <p>Desenvolvedor NodeJs Senior</p>
          <p>Remoto</p>
        </div>

        <label>Vendas</label>
        <label>Marketing</label>


        <Footer/>

      </div>
    );
  }
}

export default Carrers;
